"431802":{"id":"431802","name":"Koutetsujou no Kabaneri Movie 1: Tsudou Hikari","slug":"koutetsujou-no-kabaneri-movie-1-tsudou-hikari","original_title":"甲鉄城のカバネリ 総集編｛前編｝集う光","overview":"À medida que o mundo passa por um desenvolvimento dramático durante a Revolução Industrial, aparecem os monstros chamados Cadáveres, cujo coração está coberto por uma camada de aço. Os seres humanos caem em medo e confusão, pois os inimigos não morrem, a menos que disparem em seus corações, e os mordidos se tornam Cadáveres e atacam outros humanos. Em Hinomoto, um país insular no Extremo Oriente, havia barracas chamadas estações que podiam suportar o ataque de Cadáveres, e as pessoas viviam lá. Um deles, Ikoma, um garoto que vive na Estação Senkin, sonha em derrotar Cadáveres e trabalha duro para desenvolver uma arma chamada Canhão Perfurante. Um dia, uma garota que chamam de Sem-nome aparece na estação Senkin com a locomotiva blindada, a Fortaleza de Ferro.","first_air_date":"2016-12-31","runtime":103,"episode_run_time":[103],"vote_average":7.7,"created_by":["WIT STUDIO"],"production_companies":[{"name":"WIT STUDIO"}],"cast":["畠中祐","千本木彩花","Maaya Uchida","Yuki Kaji","Mariya Ise"],"backdrop_path":"https://image.tmdb.org/t/p/original/ylbtdu7jMqCMELBWdV7LCIXTHPZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/yZrhft8kuGUHKobg3nnZnMH29xK.jpg","certification":"N/A","genres":["Animação","Drama","Ação","Ficção científica"],"trailer":"N/A"},
