"334372":{"id":"334372","name":"Yowamushi Pedal Movie","slug":"yowamushi-pedal-movie","original_title":"劇場版 弱虫ペダル","overview":"Agora que o Intercolegial acabou e o fim do verão está se aproximando, Sakamichi treina intensamente com Shunsuke Imaizumi e Shoukichi Naruko para seguir adiante com o espírito de cooperação do Time Sohoku, que lhes foi confiado por Shingo Kinjou, Yusuke Makishima e Jin Tadokoro, os terceiranistas prestes a se formar. É então que o Time Sohoku é convidado à Prova de Ciclismo em Montanha de Kumamoto, uma corrida que reúne os times que se saíram melhor no Intercolegial, e Kinjou decide que irá participar com a equipe que disputou o Intercolegial. Ao saber que Sohoku participará, a Academia Hakone também decide participar, embora tenha recusado o convite em outros anos. Os ferozes competidores da Fushimi de Kyoto e do Kureminami de Hiroshima também anunciam sua participação. Além disso, Shin Yoshimoto, que não pôde participar do Intercolegial devido a uma lesão, está recuperado e representará o time local da Kumamoto Daiichi em busca da vitória.","first_air_date":"2015-08-28","runtime":90,"episode_run_time":[90],"vote_average":7.5,"created_by":["TMS Entertainment"],"production_companies":[{"name":"TMS Entertainment"}],"cast":["Daiki Yamashita","Jun Fukushima","伊藤健太郎","Showtaro Morikubo","Hiroki Yasumoto"],"backdrop_path":"https://image.tmdb.org/t/p/original/rACHuh9fPcX8uK5ZYL2W8Rw6B2r.jpg","poster_path":"https://image.tmdb.org/t/p/original/aeUViOBU6H09EsUpPNh4O1x7GFt.jpg","certification":"N/A","genres":["Ação","Animação"],"trailer":"N/A"},
